import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';

import DashboardScreen from '../screens/admin/DashboardScreen';
import SeriesScreen from '../screens/admin/SeriesScreen';
import EpisodesScreen from '../screens/admin/EpisodesScreen';
import UsersScreen from '../screens/admin/UsersScreen';
import AnalyticsScreen from '../screens/admin/AnalyticsScreen';

const Stack = createStackNavigator();

const AdminNavigator = () => (
  <Stack.Navigator initialRouteName="Dashboard" screenOptions={{ headerShown: true }}>
    <Stack.Screen name="Dashboard" component={DashboardScreen} />
    <Stack.Screen name="Users" component={UsersScreen} />
    <Stack.Screen name="Series" component={SeriesScreen} />
    <Stack.Screen name="Episodes" component={EpisodesScreen} />
    <Stack.Screen name="Analytics" component={AnalyticsScreen} />
  </Stack.Navigator>
);

export default AdminNavigator;
